SET IDENTITY_INSERT [dbo].[Qualifications] ON
INSERT [dbo].[Qualifications] ([QualificationId], [ShortName], [Name], [Description], [IssuingDate], [IsEnabled], [Label], [AdditionalInfo], [CustomField1], [CustomField2], [CustomField3], [CreatedBy], [ModifiedBy], [CreatedOn], [ModifiedOn]) VALUES (1, N'SBF See', N'Sportbootführerschein See', N'Der Sportbootführerschein See (SBF See) ist vorgeschrieben für das Führen von Wasserfahrzeugen mit einer Antriebsmaschine mit mehr als 5PS (3,68 kW) an der Antriebswelle auf Seeschifffahrtsstraßen und innerhalb der 3-sm-Zone in Seerevieren. Im Gegensatz zum Sportbootführerschein Binnen betrifft dieser Schein nur Motorfahrzeuge. Allerdings setzt auch das Führen von Segelyachten diesen Schein voraus, wenn diese über eine Maschine mit mehr als 5 PS (3,68 kW) verfügen.', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
INSERT [dbo].[Qualifications] ([QualificationId], [ShortName], [Name], [Description], [IssuingDate], [IsEnabled], [Label], [AdditionalInfo], [CustomField1], [CustomField2], [CustomField3], [CreatedBy], [ModifiedBy], [CreatedOn], [ModifiedOn]) VALUES (2, N'SBF Binnen', N'Sportbootführerschein Binnen', N'Bei dem Sportbootführerschein Binnen (SBF Binnen) handelt es sich um den amtlichen Sportbootführerschein zum Führen eines Sportbootes auf Bundeswasserstraßen im Geltungsbereich der Binnenschifffahrtsstraßen-Ordnung. Ein Sportboot ist dabei ein nicht gewerbsmäßig verwendetes Fahrzeug von weniger als 15 m Länge ohne Ruder und Bugspriet, ausgenommen Fahrzeuge, die durch Muskelkraft oder nur hilfsweise mit einem Treibsegel von höchstens 3 m2 Fläche fortbewegt werden. Sportboote mit einer Antriebsmaschine, deren größte nicht überschreitbare Nutzleistung höchstens 11,03 kW (15 PS) beträgt, sind von der Fahrerlaubnispflicht ausgenommen.Der SBF Binnen wird für die Antriebsarten Antriebsmaschine und Segel erteilt; beide Antriebsarten werden dabei in einem gemeinsamen Dokument bescheinigt.', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
INSERT [dbo].[Qualifications] ([QualificationId], [ShortName], [Name], [Description], [IssuingDate], [IsEnabled], [Label], [AdditionalInfo], [CustomField1], [CustomField2], [CustomField3], [CreatedBy], [ModifiedBy], [CreatedOn], [ModifiedOn]) VALUES (3, N'JUS', N'Jüngstenschein', N'Der DSV-Jüngstensegelschein gilt nur für junge Segler in ausgewählten begrenzten Revieren unter fachkundiger Leitung und dient als Befähigungsnachweis zur Führung von altersgerechten Segelbooten. Er wird mit Vollendung des 17. Lebensjahres ungültig. Die Prüfung zum Jüngstensegelschein wird durch die Prüfungskommission eines Vereines oder von einer DSV-anerkannten Segelschule nach den Zulassungsvoraussetzungen und Prüfungsinhalten der DSV-Jüngstensegelscheinvorschrift abgenommen.', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
INSERT [dbo].[Qualifications] ([QualificationId], [ShortName], [Name], [Description], [IssuingDate], [IsEnabled], [Label], [AdditionalInfo], [CustomField1], [CustomField2], [CustomField3], [CreatedBy], [ModifiedBy], [CreatedOn], [ModifiedOn]) VALUES (5, N'SSS', N'Sportsegelschein', N'Der Sportsegelschein wird ausschließlich in DSV-Vereinen ausgebildet, geprüft und erteilt. Der Sportsegelschein bescheinigt dem Inhaber die für die Ausübung der Sportart Segeln notwendigen Segel- und Regattakenntnisse.', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
INSERT [dbo].[Qualifications] ([QualificationId], [ShortName], [Name], [Description], [IssuingDate], [IsEnabled], [Label], [AdditionalInfo], [CustomField1], [CustomField2], [CustomField3], [CreatedBy], [ModifiedBy], [CreatedOn], [ModifiedOn]) VALUES (6, N'SUS', N'DSV Segelsurfschein', N'', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
INSERT [dbo].[Qualifications] ([QualificationId], [ShortName], [Name], [Description], [IssuingDate], [IsEnabled], [Label], [AdditionalInfo], [CustomField1], [CustomField2], [CustomField3], [CreatedBy], [ModifiedBy], [CreatedOn], [ModifiedOn]) VALUES (7, N'DSV-A', N'DSV-A-Lizenz', N'Befähigung zum Vermitteln der Lehrinhalte und Lernziele der Prüfungen zum Sportbootführerschein-Binnen unter Antriebsmaschine und unter Segel sowie zum Sportbootführerschein-See', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
INSERT [dbo].[Qualifications] ([QualificationId], [ShortName], [Name], [Description], [IssuingDate], [IsEnabled], [Label], [AdditionalInfo], [CustomField1], [CustomField2], [CustomField3], [CreatedBy], [ModifiedBy], [CreatedOn], [ModifiedOn]) VALUES (8, N'DSV-B', N'DSV-B-Lizenz', N'Befähigung zum Vermitteln der Lehrhinhalte und Lernziele der Prüfungen zum Sportküstenschifferschein unter Antriebsmaschine und unter Segel sowie zum Sportseeschifferschein unter Antriebsmaschine und unter Segel.', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
INSERT [dbo].[Qualifications] ([QualificationId], [ShortName], [Name], [Description], [IssuingDate], [IsEnabled], [Label], [AdditionalInfo], [CustomField1], [CustomField2], [CustomField3], [CreatedBy], [ModifiedBy], [CreatedOn], [ModifiedOn]) VALUES (9, N'DSV-C', N'DSV-C-Lizenz', N'Befähigung zum Vermitteln der Lehrinhalte und Lernziele der Prüfung zum Sporthochseeschifferschein unter Antriebsmaschine und unter Segel.', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
